import React, { Component } from 'react';
import NewSingle from './NewSingle';

class News extends Component {
    constructor(props) {
        super(props)
    }
    renderItems() {
        return this.props.items.map((item) => {
            <NewSingle key={item.id} item={item} />
        });
    }
    render() {
        return (
            <ul>
                {this.renderItems()}
            </ul>
        )
    }
}

export default News;
